import { Route } from "react-router-dom";

const Board = ({ name }) => {
  const history = useHistory();
  const onClick = () => {
    history.push('/Boards');
  };
  return (
    <div id="create-board-container">
      <button id="board-created" onClick={onClick}>
        {name}
      </button>
    </div>
  );
};

export default Board;
